      "summary": "",
      "description": "Return the chunk of GLSL code corresponding to the signed distance function. The SDF on the GLSL side should have the following signature float {{name}}_sdf(RelVector v) It takes a vector, corresponding the position and direction of the geodesic we are following and return an under-estimation of the distance from this position to the shape along this geodesic."
